          //           id="Name"
          //           value={Name}
          //           onChange={(e) => setName(e.target.value)}
          //         />
          //       </td>
          //       <td>
          //         {/* <input
          //         type="text"
          //         id="Author"
          //         value={Author}
          //         onChange={(e) => setAuthor(e.target.value)}
          //       /> */}
          //         <select name="" id="">
          //           <option value="1">1</option>
          //           <option value="2">2</option>
          //           <option value="3">3</option>
          //           <option value="4">4</option>
          //         </select>
          //       </td>
          //       <td>
          //         <input
          //           type="email"
          //           id="email"
          //           min="0"
          //           value={Email}
          //           onChange={(e) => setEmail(e.target.value)}
          //         />
          //       </td>
          //       <td>
          //         <input
          //           type="number"
          //           id="BookId"
          //           min="0"
          //           value={Book_id}
          //           onChange={(e) => setBookid(e.target.value)}
          //         />
          //       </td>
          //     </tr>
          //   </table>
          //   <input type="submit" value="Add" />
          // </form>
          <h1></h1>
        )}
      </div>

      <div>
        <h2>Students list</h2>
        <div className="availableBooks">
          <table>
            <thead>
              <tr>
                <th>Sl No.</th>
                <th>USN</th>
                <th>Name</th>
                <th className="extra"></th>
                <th className="extra"></th>
              </tr>
            </thead>
            <tbody>
              {students.map((student, i) => (
                <tr key={i}>
                  <td>{i}</td>
                  <td>{student.USN}</td>
                  <td>{student.Name}</td>
                  <td className="extra1">
                    <button
                      className="update"
                      onClick={() =>
                        Update(
                          student.USN,
                          student.Name,
                          student.Year,
                          student.Email,
                          student.Book_id
                        )
                      }
                    >
                      Update
                    </button>
                  </td>
                  <td className="extra1">
                    <button
                      className="delete"
                      onClick={() => handleDelete(student.USN)}
                    >
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default Borrowed;
